PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `photos` (`id` integer PRIMARY KEY AUTOINCREMENT, `code` varchar(255), `created_at` timestamp, `updated_at` timestamp, `photo_file_name` varchar(255), `photo_content_type` varchar(255), `photo_file_size` integer, `twitter_oauth_token` varchar(255), `twitter_oauth_secret` varchar(255), `caption` varchar(255), `facebook_access_token` varchar(255), "twitter_screen_name" varchar(255));
CREATE TABLE `schema_migrations` (`version` varchar(255) NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `unique_schema_migrations` ON `schema_migrations` (`version`);
COMMIT;
